import { Injectable } from '@angular/core';
import { Food } from '../../shared/models/Food';
@Injectable({
  providedIn: 'root',
})
export class FoodService {
  constructor() {}

  getAllDetails(): String[] {
    return ['1', '2', '3'];
  }

  getAll(): Food[] {
    return [
      {
        id: 1,
        name: 'Pasta',
        price: 700,
        tags: ['SlowFood', 'Lunch'],
        favorite: false,
        stars: 4.5,
        imageUrl: '/assets/images/img1.jpg',
        origins: ['india', 'us'],
        cookTime: '40-50',
      },
    ];
  }
}

